use std::collections::HashMap;
use std::sync::LazyLock;

/// Lookup map for added words by word form
pub static EN_ADDED_WORD_LOOKUP: LazyLock<HashMap<String, &'static PosTaggedWord>> = LazyLock::new(|| {
	let mut map = HashMap::new();
	for entry in EN_ADDED_WORDS {
		map.insert(entry.word.to_lowercase(), entry);
	}
	map
});

/// Get POS tag for an added word (case-insensitive)
pub fn get_en_added_word(word: &str) -> Option<&'static PosTaggedWord> {
	EN_ADDED_WORD_LOOKUP.get(&word.to_lowercase()).copied()
}
